import React from 'react';
import './styles.css';

export default function AppMenu({ user }) {
  console.log(user);
  return (
    <div className="app-menu">
      <img className="avatar" src={user.picture} alt="Avatar" />

      <div className="app-menu-open">
        <img className="avatar" src={user.picture} alt="Avatar" />
        <p>{user.name}</p>
      </div>
    </div>
  );
}
